   right: 0;
   width: 20px;
   height: 20px;
   background: url(https://files.catbox.moe/rbfmkt.gif) no-repeat center/contain;
}

#chat .mes_block .mes_text :not(pre code) > em,
#chat .mes_block .mes_text i:not(pre code i):not(i[class*="fa-"]) {
